'''[[VTV Cup|Giải bóng chuyền nữ quốc tế VTV Cup]] 2012''' là giải đấu lần thứ 9 với sự phối hợp tổ chức của [[Liên đoàn bóng chuyền Việt Nam]] và [[Đài Truyền hình Việt Nam]]. Giải đấu được tổ chức tại nhà thi đấu tỉnh Vĩnh Phúc. Giải đấu được sự tài trợ chính của Exim Bank, nên giải còn có tên gọi là Giải bóng chuyền nữ quốc tế VTV Eximbank Cup 2012.

